#include <iostream>
using namespace std;

// Struktur Node
struct Node {
    string nama;
    int nim;
    Node* left;
    Node* right;
};

// Fungsi untuk membuat node baru
Node* buatNode(string nama, int nim) {
    Node* node = new Node;
    node->nama = nama;
    node->nim = nim;
    node->left = node->right = NULL;
    return node;
}

// Fungsi untuk menambahkan node ke BST
Node* tambahNode(Node* root, string nama, int nim) {
    if (root == NULL) {
        return buatNode(nama, nim);
    }

    if (nim < root->nim) {
        root->left = tambahNode(root->left, nama, nim);
    } else if (nim > root->nim) {
        root->right = tambahNode(root->right, nama, nim);
    }

    return root;
}

// Fungsi untuk mencetak data BST secara Preorder
void preorder(Node* root) {
    if (root == NULL) return;
    cout << root->nama << " (" << root->nim << ") ";
    preorder(root->left);
    preorder(root->right);
}

// Fungsi untuk mencetak data BST secara Inorder
void inorder(Node* root) {
    if (root == NULL) return;
    inorder(root->left);
    cout << root->nama << " (" << root->nim << ") ";
    inorder(root->right);
}

// Fungsi untuk mencetak data BST secara Postorder
void postorder(Node* root) {
    if (root == NULL) return;
    postorder(root->left);
    postorder(root->right);
    cout << root->nama << " (" << root->nim << ") ";
}

// Fungsi untuk mencari node terkecil dalam BST
Node* cariNodeTerkecil(Node* root) {
    Node* current = root;
    while (current && current->left != NULL) {
        current = current->left;
    }
    return current;
}

// Fungsi untuk menghapus node dari BST
Node* hapusNode(Node* root, int nim) {
    if (root == NULL) return root;

    if (nim < root->nim) {
        root->left = hapusNode(root->left, nim);
    } else if (nim > root->nim) {
        root->right = hapusNode(root->right, nim);
    } else {
        if (root->left == NULL) {
            Node* temp = root->right;
            delete root;
            return temp;
        } else if (root->right == NULL) {
            Node* temp = root->left;
            delete root;
            return temp;
        }

        Node* temp = cariNodeTerkecil(root->right);
        root->nama = temp->nama;
        root->nim = temp->nim;
        root->right = hapusNode(root->right, temp->nim);
    }

    return root;
}

