/**
* Problem statement: https://leetcode.com/problems/convert-sorted-array-to-binary-search-tree/
*
* My first solution is a little slower than the second, optimized solution, which doesn't actually
* manipulate the array but just keeps track of indexes.
*
* # Intuition
* Because the array is sorted in ascending order, we can count on value on the left of the list being reliably lower than  * values on the right. 
*
* Creating a binary tree from this sorted list of values is essentially a type of binary search: Each cycle involves       * breaking the array in half and operating on each side's (left/right) half. 
* 
* # Approach
* We can use this function recursively all the way down. Starting with the full array, we pick out the middle number and   * set that as the value for our root node. Then, we set that node's 'left' and 'right' values to whatever is returned from * the left and right halves of the 'nums' array being passed into 'sortedArrayToBST'.

# Complexity
- Time complexity:
O(n) - Calculations are linear to the length of the array

- Space complexity:
O(h) - Storage needs are linear to the height of the tree (call stack)
*/

/* Initial solution */

/**
 * Definition for a binary tree node.
 * function TreeNode(val, left, right) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.left = (left===undefined ? null : left)
 *     this.right = (right===undefined ? null : right)
 * }
 */
/**
 * @param {number[]} nums
 * @return {TreeNode}
 */
var sortedArrayToBST = function(nums) {
  if (nums.length < 1) return null

  const mid = Math.floor(nums.length / 2)
  const root = new TreeNode(nums[mid])

  root.left = sortedArrayToBST(nums.slice(0, mid))
  root.right = sortedArrayToBST(nums.slice(mid + 1))

  return root
};


/* More-efficient solution without array manipulation */

/**
 * @param {number[]} nums
 * @return {TreeNode}
 */
function sortedArrayToBST(nums) {
  return getRootAndLeaves(nums, 0, nums.length - 1)
}

function getRootAndLeaves(nums, beginning, end) {
  if (beginning > end) return null

  const mid = Math.ceil((beginning + end) / 2)
  const root = new TreeNode(nums[mid])

  root.left = getRootAndLeaves(nums, beginning, mid - 1)
  root.right = getRootAndLeaves(nums, mid + 1, end)

  return root
}

