// Java Program to Illustrate 
// Invocation of Constructor
// Calling Without Usage of 
// super Keyword 

// Class 1
// Super class
class Base {

	// Constructor of super class
	Base()
	{
		// Print statement
		System.out.println(
			"Base Class Constructor Called ");
	}
	
	void print() {
	    
	    System.out.println("Base Class Print ");
	}
	    
	
}

// Class 2
// Sub class
class Derived extends Base {

	// Constructor of sub class
	Derived()
	{

		// Print statement
		System.out.println(
			"Derived Class Constructor Called ");
	}
	
	void print() {
	    
	    System.out.println("Derived Class Print ");
	}
	
	void print(String s) {
	    
	   System.out.println("Derived Class Print " + s);
	    
	}
	
}

// Class 3
// Main class
public class GFG {

	// Main driver method
	public static void main(String[] args)
	{

		// Creating an object of sub class
		// inside main() method
		Derived d = new Derived();
		
		d.print();
		
		d.print("overloaded");

		// Note: Here first super class constructor will be
		// called there after derived(sub class) constructor
		// will be called
	}
}
